import {React, Component} from "react";


class TodoList extends Component {
    state = {         
        todos: [
        {
        id: 1,
        title: "Setup development environment",
        completed: true
      },
      {
        id: 2,
        title: "Develop website and add content",
        completed: false
      },
      {
        id: 3,
        title: "Deploy to live server",
        completed: false
      }
    ] } 
    render() { 
        return (
            <ul>
                {this.props.todo}
            </ul>
        );
    }
}
 
export default TodoList;
